    return (
        <div>
            {" "}
            {openRegisterModal && openRegisterModal && (
                <RegisterModal
                    openRegisterModal={openRegisterModal}
                    setOpenRegisterModal={() => setOpenRegisterModal(false)}
                />
            )}
            <button
                onClick={() => setOpenRegisterModal(true)}
                className="btn btn-primary"
            >
                REGISTER
      </button>
        </div>
    );
};
export default portfolios;
